import React, {Component} from 'react';
import NewsletterInfo from "../../Components/NewsletterInfo/Newsletter_Info";
import BottomInfo from "../../Components/BottomInfo/BottomInfo";
import TopMenu from "../../Components/TopMenu/TopMenu";
import ProductList from "../../Components/Shop/ProductList";
import TopImg from "../../Components/Shop/topImg.png";
import TopTooltip from "../../Components/Shop/TopTooltip";
import { BrowserRouter, Route, Switch } from 'react-router-dom';
class Shop extends Component {

  constructor(props) {

    super(props)

    this.props = props;

    this.state = {
      id: null,
    }
  

  
  }

  render() {

    
    return (
<BrowserRouter>
      

        <div className="shop">


          <TopTooltip/>;
          
          <img className="shop__topImg" src={TopImg} alt="graphics"/>
          <NewsletterInfo />
          <BottomInfo />
          <TopMenu />

          
         
         <Switch>
          <Route path="/" exact render={() => {<ProductList returnLocation="all" />}} />
          <Route path="/ring" render={() => {<ProductList returnLocation="ring" />}} />
          <Route path="/bracelets" render={() => {<ProductList returnLocation="bracelets" />}} />
          <Route path="/necklaces" render={() => {<ProductList returnLocation="necklaces" />}} />
          <Route path="/earrings" render={() => {<ProductList returnLocation="earrings" />}} />
          </Switch>
          
          

        </div>

</BrowserRouter>
    );
  }
}

export default Shop;
